import './App.css';

const App = () => {
  const [todos, setTodos] = useState([
    { text: "Buy Food" },
    { text: "Learn React" },
    { text: "Build todo app" }
  ]);

  return (
    <div className="app">
      <div className="todo-list">
        {todos.map(todo => (
          <div className="todo-item">{todo.text}</div>
        ))}
      </div>
    </div>
  );
}

export default App;
